import navlogo from "../images/bc-nav-logo.png";
import "../styles/Navbar.css";
import { useNavigate } from "react-router-dom";

export default function Header() {
  const navigate = useNavigate();

  return(
    <div>
      <nav id="navbar" className="navbar">
      <img src={navlogo} className="logo" alt="Braving Counseling Logo for Navbar" />
      <ul>
        <li 
          className="amatic-sc-regular"
          onClick={()=> {

          }}
        >
          Home
        </li>
        <li className="amatic-sc-regular">Login</li>
        <li className="amatic-sc-regular">About</li>
        <li className="amatic-sc-regular">Services</li>
        <li className="amatic-sc-regular">Resources</li>
        <li className="amatic-sc-regular">FAQ</li>
        <li className="amatic-sc-regular">Contact</li>
      </ul>
      </nav>
  </div>
  )
}
